        self.writeScId(28, self.player.profile_icon)  # Icon ID

        self.writeVint(0)       # array
        self.writeVint(len(self.player.brawlers_skins))
        for brawler_id in self.player.brawlers_skins:
            self.writeVint(29)
            self.writeVint(self.player.brawlers_skins[brawler_id])  # skinID

        # Unlocked Skins array
        self.writeVint(len(self.player.ownSkinsArray))
        for x in self.player.ownSkinsArray:
            self.writeScId(29, x)

        self.writeBoolean(False) # Leaderboard global TID

        self.writeVint(0)
        self.writeVint(self.player.keysReward) # animation keys
        self.writeVint(self.player.trophiesReward) # animation trophies
        self.writeVint(self.player.starkeysReward) # animation star keys
        self.writeVint(0)
        self.writeVint(0)

        self.writeBoolean(False) # token limit reached message
        self.writeVint(1)
        self.writeBoolean(True)

